import React,{
  Component
} 
from 'react';

import Pomodoro from "./components/pomodoro";
import Timer from "./functions/timer";

class App extends Component {
  render(){
    const timer = new Timer(20000);

    timer.onStart(() => {
      console.log("start");
    })
    .onEnd(() => {
      console.log("end");
    })
    .onInterval(() => {
      console.log("interval");
    })
    .start();

    console.log("abra");

    return (
      <Pomodoro
      onChangeBreakLength={() => console.log(1)}
      onChangeSessionLength={() => console.log(1)}

      onClickStart={() => timer.start()}
      onClickStop={() => timer.stop()}
      onClickReset={() => console.log(1)}

      display={"00:00:00"}/>
    );
  }
}

export default App;
